import "./case.module.scss";

import React, { Component } from "react";

export default class Case extends Component {
  constructor(props) {
    super(props);
    this.state = {
      imagePath: window.location.origin + this.props.img
    };
  }

  render() {
    return (
      <a className='case'>
        <img src={require(`${this.state.imagePath}`)} alt='' />
        <span>{this.props.title}</span>
      </a>
    );
  }
}
